import React from 'react';

function StockList({stocks}){
  console.log(stocks);
	return (
   <ol className="stock-list"> 
    {
    stocks.map((stockMap,index)=>{
      return  <li key={index}>
            <div className="stock-item">
                <span></span>
            </div> 
      </li>
    })
    }
    </ol>
	);
};

export default StockList;
